import React from 'react';
import {Link} from 'react-router-dom';

function Main () {
    return(
       <div>
            <Link to="./userRoute/user">
                <button class="btn btn-primary btn-ghost">사용자</button>
            </Link>
            <button class="btn btn-primary btn-ghost">조회 기관</button>
            <button class="btn btn-primary btn-ghost">헌혈 기관</button>
       </div>
    )
}

export default Main;
